import React from 'react'
import './Teampage.css'
import Teamcard from '../../components/Teamcard/Teamcard'


const TeamPage = () => {
  const teamMembers = [
      {
          name: 'Regina Jaslow',
          title: 'Co-Founder and CEO',
          imageUrl: '/path-to-image/regina.jpg',
          linkedinUrl: 'https://linkedin.com/in/regina',
      },
      {
          name: 'Noam Rosenberg',
          title: 'Co-Founder and CTO',
          imageUrl: '/path-to-image/noam.jpg',
          linkedinUrl: 'https://linkedin.com/in/noam',
          githubUrl: 'https://github.com/noam',
      },
  ];

  return (
      <div className="team-page">
          <h1 className="team-page__title">Team</h1>
          <h2 className="team-page__subtitle">About Us</h2>
          <div className="team-page__members">
              {teamMembers.map((member, index) => (
                  <Teamcard key={index} {...member} />
              ))}
          </div>
      </div>
  );
};

export default Teampage
